import React from 'react'
import Button from '../UIComponent/Button'
import { connect } from 'react-redux'
import { DeleteTodo } from '../../../Actions/todo'
const mapDispatchToStores = dispatch => ({
    DeleteTodo: item => dispatch(DeleteTodo(item))
})

class TodoDelete extends React.Component {
    handleDelete = () => {
        const { data } = this.props;
        this.props.DeleteTodo(data);
    }
    render() {
        const { disabled } = this.props;
        return (
            <div>
                <Button type={'delete'} disabled={disabled} onClick={this.handleDelete}>Delele</Button>
            </div>
        )
    }
}

export default connect(null,mapDispatchToStores)(TodoDelete);
